import ReactDom from 'react-dom/client';
import { Routes, Route } from 'react-router-dom'
import Main from './components/Main'
import Landing from './components/Landing'
function App() {

  // <Main />
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Landing />} />
        <Route path="/" element={<Main />} />
      </Routes>
    </div>
  );
}

export default App;
